import React from "react";
//======================================================================//
const PhotoGrid = ({ place }) => (
  <div style={{position:"relative"}}>
    <img
      alt="sihgts"
      style={{ width: "300px", height: "300px", padding: "10px" }}
      src={place.photosUrl}
    />
    <div style={{top:'50px',position:'absolute',backgroundColor:'white',color:'black',}}>{place.name}</div>
  </div>
);

export default PhotoGrid;
